package com.raychenon.leetcode;

import org.junit.BeforeClass;
import org.junit.Test;

import java.util.Arrays;
import java.util.List;

import static junit.framework.TestCase.assertEquals;

/**
 * User: raychenon
 * Date: 2019-10-03
 * https://leetcode.com/problems/find-all-anagrams-in-a-string
 */
public class FindAllAnagramsInaStringTest {

    private static FindAllAnagramsInaString instance;

    @BeforeClass
    public static void setUp() {
        instance = new FindAllAnagramsInaString();
    }

    @Test
    public void findAnagram_abc_Test() {
        List<Integer> output = Arrays.asList(0, 6);
        assertListEquals(output, instance.findAnagrams("cbaebabacd", "abc"));
    }

    @Test
    public void findAnagram_ab_Test() {
        List<Integer> output = Arrays.asList(0, 1, 2);
        assertListEquals(output, instance.findAnagrams("abab", "ab"));
    }

    @Test
    public void superLonStringTest() {
        List<Integer> output = Arrays.asList(0, 10001);
        assertListEquals(output, instance.findAnagrams(
                "",
                ""));
    }

    private void assertListEquals(List<Integer> list1, List<Integer> list2) {
        assertEquals(list1.size(), list2.size());
        for (int i = 0; i < list1.size(); i++) {
            assertEquals(list1.get(i), list2.get(i));
        }
    }

}
